export const getEvents = (location) => fetch("http://api.eventful.com/json/events/search?app_key=HkgwXkPs5xHpDpR2&location="+location, {
    method: "GET",
    cors: "cors",
    headers: new Headers({
        "Access-Control-Allow-Origin": "http://localhost:3000"
    })
}).then((res) => {
    return res.json();
});
